import React, { useState} from "react";
import { ToggleButton , Button } from 'react-bootstrap';
import ButtonGroup from "reactstrap/es/ButtonGroup";
import './home.css';

function Home()
{
    const [radioValue, setRadioValue] = useState('1');

    const radios = [
    { name: 'Wallet 1', value: '1' },
    { name: 'Wallet 2', value: '2' },
    { name: 'Wallet 3', value: '3' },
    ];


        return(
            <div>
                <div className="jumbotron" >
                    <div className="text-left" style={{fontFamily:'cursive' , color: 'green' , fontSize: '60px'}}>
                        <h1><b> Welcome to waas portal</b></h1>
                    </div>
                    <div className="text-right">
                        <b>Your Current wallets:  </b>
                        <ButtonGroup size="lg">
                            <Button>W1</Button>
                            <Button>W2</Button>
                            <Button>W3</Button>
                        </ButtonGroup>
                        <br/><br/>
                        <Button variant="flat">Add a new Wallet</Button>

                    </div>
                </div>

                <div className="container">
                    <Button variant="secondary" size="lg" >Funds Transfer</Button><br/><br/>
                    <Button variant="secondary" size="lg" >Manage Status</Button><br/><br/>
                    <Button variant="secondary" size="lg" >Add/Delete Wallet</Button><br/><br/>
                    <Button variant="secondary" size="lg" >Generate Statement</Button><br/><br/>
                </div>



            </div>
        )

}
export default Home;
